import React from 'react'
import './index.css'
import Header from './Header'
import SecondSection from './SecondSection'
import ThirdSection from './ThirdSection'
import Footer from './Footer'
function App() {
  return (
    <div className="App">
     <Header/>
     <SecondSection/>
     <ThirdSection/>
     <Footer/>
    </div>
  );
}

export default App;
